const MAX_POINTER_VALUE = 255;
const MIN_POINTER_VALUE = 0;

const movePointerRight = ( memory, pointer ) => {
    if ( memory.length - 1 <= pointer )
        memory.push( 0 );
    return ++pointer;
};

const movePointerLeft = ( pointer ) => --pointer;

const incrementMemoryValue = ( memory, pointer ) => {
    ( memory[ pointer ] === MAX_POINTER_VALUE )
        ? memory[ pointer ] = MIN_POINTER_VALUE
        : memory[ pointer ]++;

};

const decrementMemoryValue = ( memory, pointer ) => {
    ( memory[ pointer ] === MIN_POINTER_VALUE )
        ? memory[ pointer ] = MAX_POINTER_VALUE
        : memory[ pointer ]--;
};

const jumpAfterLoop = ( memory, pointer, instructionsArray, positionInstructionsArray ) => {
    if ( memory[ pointer ] === 0 ) {
        let fistRight = 1;
        for( let i = positionInstructionsArray + 1; i < instructionsArray.length; i++ ) {
            if ( instructionsArray[ i ] === 'ðŸ¤œ' ) 
                fistRight++;
            if ( instructionsArray[ i ] === 'ðŸ¤›' )
                fistRight--;
            if ( fistRight === 0 ) {
                return i;
            }
        }
    }
    return positionInstructionsArray;
}
const jumpStartLoop = ( memory, pointer, instructionsArray, positionInstructionsArray ) => {
    if ( memory[ pointer ] !== 0 ) {
        let fistLeft = 1;
        for( let i = positionInstructionsArray - 1; i > 0; i-- ) {
            if ( instructionsArray[ i ] === 'ðŸ¤œ' ) 
                fistLeft--;
            if ( instructionsArray[ i ] === 'ðŸ¤›' )
                fistLeft++;
            if ( fistLeft === 0 ) {
                return i;
            }
        }
    }
    return positionInstructionsArray;
};

const displayCurrentCharacter = ( memory, pointer, output ) => {
    process.stdout.write( String.fromCharCode( memory[ pointer ] ) );
    return output + String.fromCharCode( memory[ pointer ] );
}


const handProgrammingLanguage = ( input ) => {
    const instructionsArray = Array.from( input );
    let positionInstructionsArray = 0;
    const memory = [ 0 ];
    let pointer = 0;
    let output = '';
    while ( positionInstructionsArray < instructionsArray.length ) {
        if ( instructionsArray[ positionInstructionsArray ] === 'ðŸ‘‰' )
            pointer = movePointerRight( memory, pointer );
        else if ( instructionsArray[ positionInstructionsArray ] === 'ðŸ‘ˆ' )
            pointer = movePointerLeft( pointer );
        else if ( instructionsArray[ positionInstructionsArray ] === 'ðŸ‘†' )
            incrementMemoryValue( memory, pointer );
        else if ( instructionsArray[ positionInstructionsArray ] === 'ðŸ‘‡' )
            decrementMemoryValue( memory, pointer );
        else if ( instructionsArray[ positionInstructionsArray ] === 'ðŸ¤œ' )
            positionInstructionsArray = jumpAfterLoop( memory, pointer, instructionsArray, positionInstructionsArray );
        else if ( instructionsArray[ positionInstructionsArray ] === 'ðŸ¤›' )
            positionInstructionsArray = jumpStartLoop( memory, pointer, instructionsArray, positionInstructionsArray );
        else
            output = displayCurrentCharacter( memory, pointer, output );
        // console.log({ action: `${ instructionsArray[ positionInstructionsArray ] }`, positionInstructionsArray, memory, pointer, output })
        // console.log({ output })
        positionInstructionsArray++;
    }
    return output;
}

